def _unstack_multiple(data, clocs, fill_value=None):
    if len(clocs) == 0:
        return data

    index = data.index

    clevels = [index.get_level_values(i) for i in clocs]
    rlevels = [index.get_level_values(i) for i in range(index.nlevels) if i not in clocs]

    if isinstance(data, Series):
        unstacked = data.unstack(clocs, fill_value=fill_value)
    else:
        unstacked = data.unstack(clocs, fill_value=fill_value)

        new_levels = list(clevels) + list(unstacked.columns.levels)
        new_names = list(index.names) + list(unstacked.columns.names)

        new_columns = MultiIndex.from_tuples(
            [(*col, *index_vals) for col in unstacked.columns for index_vals in zip(*rlevels)],
            names=[*new_names, *rnames]
        )

        if isinstance(unstacked, Series):
            unstacked.index = new_columns
        else:
            unstacked.columns = new_columns

    return unstacked
